(44, 'Toyota Prado', 'Toyota', 'Toyota Prado-vendor1', 2600000, 6, 16, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">The Diesel engine is 4461 cc while the Petrol engine is 3956 cc . It is available with the Automatic transmission. Depending upon the variant and fuel type the&nbsp;</span><strong style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">prado</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">&nbsp;has a mileage of 7.3 to 8.0 kmpl. The&nbsp;</span><strong style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">prado</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">&nbsp;is a 8 seater and has length of 4,715 mm, width of 1,875 mm and a wheelbase of 2,790 mm.</span></p>', '40', NULL, 1, 0, '[\"images\\/tamjid\\/4\\/products\\/44\\/PRADO.JPG\"]', 4, '\"none\"', '2021-02-07 11:14:22', '2021-02-07 11:14:32', 'used', NULL, NULL),
(45, 'Toyota supra 2020', 'Toyota', 'Toyota supra 2020-vendor1', 5500000, 6, 15, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">Performance and Fuel Economy. The&nbsp;</span><strong style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">2020 Toyota Supra</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">&nbsp;has a 3.0-liter turbo I-6 with 335&nbsp;</span><strong style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">hp</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">&nbsp;and 365 lb-ft of torque. With the standard eight-speed automatic transmission, the&nbsp;</span><strong style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">2020 Supra</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">&nbsp;is EPA-rated at 24/31 mpg city/highway. There is 10.2 cubic feet of cargo space under the&nbsp;</span><strong style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">2020 Supra\'s</strong><span style=\"background-color: rgb(255, 255, 255); color: rgb(32, 33, 36);\">&nbsp;rear hatch</span></p>', '10', NULL, 1, 0, '[\"images\\/tamjid\\/5\\/products\\/45\\/SUPRA.PNG\"]', 5, '\"none\"', '2021-02-07 11:22:29', '2021-02-07 11:22:37', 'used', NULL, NULL),
(46, 'Toyota supra GR', 'Toyota', 'Toyota supra GR-vendor1', 6000000, 6, 15, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(0, 0, 0);\">the car\'s turbocharged 3.0-liter inline-six, dialing up its horsepower from 335 to 382. To help the Supra broaden its reach, the company is also adding a four-cylinder model to the lineup, which is powered by a turbocharged 2.0-liter inline-4 that makes 255 horsepower.&nbsp;</span></p>', '5', NULL, 1, 0, '[\"images\\/tamjid\\/5\\/products\\/46\\/GR.JPG\"]', 5, '\"none\"', '2021-02-07 11:25:29', '2021-02-07 11:25:35', 'used', NULL, NULL),
(47, 'Audi A4', 'Audi', 'Audi A4-vendor1', 3500000, 6, 17, '<p><span style=\"background-color: rgb(251, 251, 251); color: rgb(111, 111, 111);\">The outgoing version of the A4 was powered by a 1.4-litre petrol motor. This unit is expected to be replaced by a 2.0-litre TFSI petrol engine, which is the same engine used in the&nbsp;</span><a href=\"https://www.carwale.com/audi-cars/q2/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(251, 251, 251); color: rgb(2, 136, 209);\">Q2</a><span style=\"background-color: rgb(251, 251, 251); color: rgb(111, 111, 111);\">. This engine produces 188bhp and 320Nm of torque in the 40TFSI guise.</span></p>', '0', NULL, 2, 0, '[\"images\\/tamjid\\/4\\/products\\/47\\/A4.JPG\"]', 4, '\"none\"', '2021-02-07 11:31:21', '2021-02-07 11:31:29', 'used', NULL, NULL),
(48, 'Audi RS Q8', 'Audi', 'Audi RS Q8-vendor1', 4500000, 6, 17, '<p><span style=\"background-color: rgb(251, 251, 251); color: rgb(111, 111, 111);\">Audi has expanded its high performance range in India with the arrival of the RSQ8. It’s the first performance SUV from the German automaker, and is powered by a 4.0-litre TFSI twin-turbo V8 engine producing 600bhp/800Nm. This engine is mated to an eight-speed automatic, and using Audi’s patented Quattro AWD technology sends power to all four wheels. You get a 0-100kmph time in just 3.8 seconds with a top speed of 250kmph.</span></p>', '22', NULL, 1, 0, '[\"images\\/tamjid\\/4\\/products\\/48\\/RSQ8.JPG\"]', 4, '\"none\"', '2021-02-07 11:32:49', '2021-02-07 11:32:56', 'used', NULL, NULL),
