(2, '[\"images\\/dadadadada\\/9\\/products\\/2\\/1615439310.jpg\"]', 5500000, 2, 3, 1400, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(112, 118, 118);\">Luxurious 3 beds, 3 bathroom, Living, Dining, Kitchen, Servant Toilet, Car Parking, Lift, Generator, Mirror polish homogeneous tiles.</span></p><p><br></p>', 7, 19, 'Dhaka', 'Sector 11', 'Uttara', 9, '2021-03-10 23:08:20', '2021-03-10 23:08:30'),
