(4, '[\"images\\/dadadadada\\/9\\/products\\/4\\/1615699793.jpg\"]', 12000000, 0, 0, 2200, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">Keeping that in mind those who are looking for a vacant space to shift your business right now can check this vacant space. This building is located in the busiest suburb of Gulshan. The transportation stops are located very near to this building. Very tasteful design, ample spacing and durable fittings are some of the many features that you are going to get into this building</span></p>', 7, 20, 'Dhaka', '2', 'Gulshan', 9, '2021-03-13 23:29:39', '2021-03-13 23:29:53'),
(5, '[\"images\\/dadadadada\\/9\\/products\\/5\\/1615699883.jpg\"]', 24000000, 0, 0, 3000, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">This vacant business space located in Gulshan is having all the modern fittings along with security. </span></p>', 7, 20, 'Dhaka', '1', 'Gulshan', 9, '2021-03-13 23:31:11', '2021-03-13 23:31:23'),
(6, '[\"images\\/dadadadada\\/9\\/products\\/6\\/1615700161.jpg\"]', 18000000, 3, 5, 2300, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">You will enjoy all-time water, gas and electricity while you will be a residence of this building. Some good, school, colleges and everyday transportation facilities are very close to this flat. All the washrooms are attached with quality and durable fixtures. In this place, you will find every service to live a good life. </span></p>', 7, 19, 'Dhaka', '15', 'Dhanmondi', 9, '2021-03-13 23:35:43', '2021-03-13 23:36:01'),
(7, '[\"images\\/dadadadada\\/9\\/products\\/7\\/1615700260.jpg\"]', 16000000, 0, 0, 2400, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">This commercial Office situated in a great location that will provide you the convenience to run your business to its success. Beside located in a suitable location the property also assures all time water, gas and electricity. The property is created with a great floor plan. </span></p>', 7, 21, 'Dhaka', 'Mirpur 1', 'Mirpur', 9, '2021-03-13 23:37:25', '2021-03-13 23:37:40'),
(8, '[\"images\\/dadadadada\\/9\\/products\\/8\\/1615700487.jpg\"]', 11000000, 0, 0, 2500, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">With a good floor plan, this space has very comfortable features which can meet your commercial demand. The inside architecture is very impressive as well. Water, Electricity and well security is also available. </span></p>', 7, 20, 'Dhaka', 'Shekhertek', 'Mohammadpur', 9, '2021-03-13 23:41:19', '2021-03-13 23:41:27'),
(9, '[\"images\\/dadadadada\\/9\\/products\\/9\\/1615700586.jpg\"]', 8000000, 2, 4, 1600, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">The flat has got amazing bedrooms that give you room privacy and comfort. All the washrooms are completed with quality and durable fixtures. You will have an apt kitchen area to have your desired cookery essentials just beside the dining area. </span></p>', 7, 19, 'Dhaka', 'Ringroad', 'Mohammadpur', 9, '2021-03-13 23:42:54', '2021-03-13 23:43:06'),
(10, '[\"images\\/dadadadada\\/9\\/products\\/10\\/1615700716.jpg\"]', 7000000, 0, 0, 1800, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">This commercial property situated in a great location that will provide you the convenience to run your business to its success. Beside located in a suitable location the property also assures all time water, gas and electricity. The property is created with a great floor plan. </span></p>', 7, 20, 'Dhaka', 'Mirpur 12', 'Mirpur', 9, '2021-03-13 23:44:56', '2021-03-13 23:45:16'),
(11, '[\"images\\/dadadadada\\/9\\/products\\/11\\/1615700814.jpg\"]', 12000000, 2, 3, 1500, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">A fortified living has become a must when it comes to securing a permanent address in this busy city. Kalabagan brings you this wonderful house. With an area of which will provide you ample space the flat also assures all time water, gas and electricity. The apartment comes within your affordability in this wonderful location. The flat for rent provides the exact comfortable living you have been looking for.  </span></p>', 7, 19, 'Dhaka', '1st lane', 'Kalabagan', 9, '2021-03-13 23:46:46', '2021-03-13 23:46:54'),
(12, '[\"images\\/dadadadada\\/9\\/products\\/12\\/1615700920.jpg\"]', 6500000, 2, 2, 1250, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">The house presents a drawing room adjoined to the dining room. The corresponding unit of this building holds a very spacious floor plan with large size windows. The kitchen is beautifully equipped with well-fitted tiles and cabinet to whip up a feast for the family. The rooms are well prepared with the finest quality fixtures and the washrooms are installed with a high durability guarantee. </span></p>', 7, 19, 'Dhaka', '13', 'Uttara', 9, '2021-03-13 23:48:35', '2021-03-13 23:48:40'),
(13, '[\"images\\/dadadadada\\/9\\/products\\/13\\/1615947673.jpg\"]', 5500000, 2, 3, 1200, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">The flat has got an open floor plan, all over tiled flooring and soothing painting which are some of the great features this home is going to offer. All-time utilities, large windows and spot on security is also there. For the comfiest living for your family the flat has beautiful kitchen with durable fittings. The balconies would refill the happy time with your family after a hectic day. </span></p>', 7, 19, 'Dhaka', 'Mirpur 6', 'Mirpur', 9, '2021-03-16 20:20:58', '2021-03-16 20:21:13'),
(14, '[\"images\\/dadadadada\\/10\\/products\\/14\\/1615948325.jpg\"]', 7500000, 3, 3, 14000, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">This exquisite building covers a very homey entrance to take you to this apartment that you can see in our enlisted images. The apartment has got large windows and balconies to replenish some happy time with your family. </span></p>', 7, 19, 'Dhaka', 'Mirpur 2', 'Mirpur', 10, '2021-03-16 20:31:47', '2021-03-16 20:32:05'),
(15, '[\"images\\/dadadadada\\/10\\/products\\/15\\/1615948403.jpg\"]', 6500000, 2, 4, 1350, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">It is the exact place if you are looking for one of the most picked and affordable properties in a congenial zone like Mirpur. We got a flat for rent in this area very affordable and lovely. A beautiful kitchen with durable fittings is there to make your cooking time comforting. </span></p>', 7, 19, 'Dhaka', 'Mirpur 12', 'Mirpur', 10, '2021-03-16 20:33:16', '2021-03-16 20:33:23'),
(16, '[\"images\\/dadadadada\\/10\\/products\\/16\\/1615948531.jpg\"]', 12500000, 3, 4, 1700, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">The most beautiful part of Dhanmondi is the pristine lake that reflects the beauty of the trees which surround it. The lush greenery and the locations nearby with their splendid tea stalls and delectable street food make the location an attraction of Dhaka. Residents have been living here for generations and some of the homes here do have historical significance. Transport facilities in Dhanmondi are obviously excellent and it\'s easy to move to any part of the city from here. </span></p>', 7, 19, 'Dhaka', 'Dhanmondi 4/a', 'Dhanmondi', 10, '2021-03-16 20:35:26', '2021-03-16 20:35:31'),
(17, '[\"images\\/dadadadada\\/10\\/products\\/17\\/1615948648.jpg\"]', 8500000, 3, 3, 1500, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">This is a great place to reside in, having an area with a good number of shopping places and schools. The apartment is cozy and all utility supplies readily accessible. Serene and fortified living has become a must when it comes to securing a permanent address in a busy city like Dhaka. </span></p>', 7, 19, 'Dhaka', 'Tajmahal road', 'Mohammadpur', 10, '2021-03-16 20:37:17', '2021-03-16 20:37:28'),
(18, '[\"images\\/dadadadada\\/10\\/products\\/18\\/1615948766.jpg\"]', 8000000, 0, 0, 2200, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">A well constructed and nicely planned commercial space is up for sell. The property is located in a place that will provide you with location benefits which are undoubtedly one of the most crucial elements for a successful business. This is the exact location to run your business smoothly.  </span></p>', 7, 20, 'Dhaka', 'Block C', 'Lalmatia', 10, '2021-03-16 20:39:17', '2021-03-16 20:39:26'),
(19, '[\"images\\/dadadadada\\/10\\/products\\/19\\/1615949553.jpg\"]', 12000000, 0, 0, 1800, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">Are you thinking of expanding your current business or need a new location for your new venture? As an expansion of your business to a new place assures your business growth and success, we think you would be willing to do that. This vacant business space located in Gulshan is having all the modern fittings along with security. </span></p>', 7, 20, 'Dhaka', 'Section 1', 'Gulshan', 10, '2021-03-16 20:52:14', '2021-03-16 20:52:33'),
(20, '[\"images\\/dadadadada\\/10\\/products\\/20\\/1615949734.jpg\"]', 7000000, 2, 2, 1100, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">We are here to serve you if you are thinking of starting a residence in an easy-going area like Mirpur. Mirpur is offering a flat for sale to pick it for your next home. A good amount of school, college and groceries will be located right nearby to your home. It also features nice balcony, drawing, dining and a kitchen. All-time electricity backup with updated apartment fittings will make your life smooth. </span></p>', 7, 19, 'Dhaka', 'Mirpur 12', 'Mirpur DOHS', 10, '2021-03-16 20:55:27', '2021-03-16 20:55:34'),
(21, '[\"images\\/dadadadada\\/10\\/products\\/21\\/1615949981.jpg\"]', 14000000, 3, 4, 1560, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">Lovely apartment is vacant at the moment. You get all the facilities you need along with a spacious place to live in. Nearby locations have multiple shopping spots and eateries. There is one active and well-maintained elevator and staircase to lead you to this superb dwelling. The apartment has got balconies which would refill the happy time with your family. </span></p>', 7, 19, 'Dhaka', '2nd lane', 'Kalabagan', 10, '2021-03-16 20:59:33', '2021-03-16 20:59:41'),
(22, '[\"images\\/dadadadada\\/10\\/products\\/22\\/1615950099.jpg\"]', 7900000, 2, 4, 1450, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">Peaceful environment, convenient commuting system and satisfactory prices! Yes, we are talking about the area Badda. The great news is, a beautiful flat is vacant right now for sale in the location. No need to be concern about utilities as water, gas and electricity is all time available in the apartment. If you are looking for a modern well-planned flat then you can undoubtedly choose this one. </span></p>', 7, 19, 'Dhaka', 'middle', 'Badda', 10, '2021-03-16 21:01:32', '2021-03-16 21:01:39'),
(23, '[\"images\\/dadadadada\\/10\\/products\\/23\\/1615950249.jpg\"]', 8500000, 3, 3, 1440, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">The apartment located in the amazing location of Kathalbagan is a must-see apartment for the property hunters. You need to see the apartment by yourself to know how perfect it can be as your new home. A nice kitchen with durable fittings is there to make your cooking time comforting. Large parking with all time security service adds an extra benefit for your living. </span></p>', 7, 19, 'Dhaka', 'Free School Street', 'Kathalbagan', 10, '2021-03-16 21:03:58', '2021-03-16 21:04:09'),
(24, '[\"images\\/dadadadada\\/10\\/products\\/24\\/1615951226.jpg\"]', 7500000, 3, 3, 1350, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">A happy future in your dream home is in your hand now. This will be so well designed that it will provide you a premium living and exclusive comforts. The plan reflects the vision of a community where you will get a convenient place in terms of infrastructure, design and urban planning. At the same time it is also offering you the satisfactory value for your money. </span></p>', 7, 19, 'Dhaka', 'Mirpur 10', 'Mirpur', 10, '2021-03-16 21:20:20', '2021-03-16 21:20:26'),
(25, '[\"images\\/dadadadada\\/10\\/products\\/25\\/1615951340.jpg\"]', 15500000, 3, 4, 1850, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">Banani takes bits and pieces of the best in the city, to create an experience worth having. There are multiple places to visit and more to remember. With high end restaurants and shopping centers on one side, you’ll think this places is all hype. On the other end, things are as calm as a breeze. This apartment is perfectly designed and structured to provide an incredible home. There’s space, light and at unexpected moments, you will find a gentle wind that will take the stress away. Rooms have utilized space properly and the kitchen can keep you in for hours. </span></p>', 7, 19, 'Dhaka', 'Block C', 'Banani', 10, '2021-03-16 21:22:12', '2021-03-16 21:22:20'),
(26, '[\"images\\/dadadadada\\/10\\/products\\/26\\/1615951518.jpg\"]', 35000000, 4, 4, 2560, '<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(34, 34, 34);\">Considering a suitable lifestyle, this is one of the best places to reside in. It is wonderful and comfortable flat for a family to move in. The respective unit welcomes with a great floor plan. The flat has got amazing bedrooms with modish tiled flooring. All the washrooms are finished with the quality and durable fixtures. You will have an apt kitchen area to have your desired cookery essentials. A great number of groceries, school, colleges and bus stops are also located in the nearby area. </span></p>', 7, 19, 'Dhaka', 'Road 2', 'Paribagh', 10, '2021-03-16 21:24:55', '2021-03-16 21:25:18');
